import React from "react";
import styles from "../Style/Error404.module.css"; // You can create a new CSS module for styling

const Error404 = () => {
  return (
    <div className={styles.container}>
      <img src="/image/404.png" alt="404 Error" className={styles.image} />
      <h1 className={styles.title}>404 - 페이지를 찾을 수 없습니다.</h1>
      <p className={styles.text}>요청하신 페이지가 존재하지 않습니다.</p>
    </div>
  );
};

export default Error404;
